script: |
  super -f text -I q13250.spq | sort > q13250.out

inputs:
  - name: q13250.spq
    data: |
      SELECT col0 FROM tab1 (FORMAT parquet) WHERE NOT - 83 NOT IN ( 9 - - - col0, 22 + ( 9 ) * + + col1 * col0 ) OR NOT 43 NOT IN ( - col0 );
  - name: tab1

outputs:
  - name: q13250.out
    data: |
